import React from 'react';
import ReactDOM from 'react-dom';
import App from "./App"
import store from './redux/store'
import  {subscribe}  from 'redux'
//放在index.js引入store,再通过props传递




subscribe(ReactDOM.render(<App store={store} />,document.getElementById("root")))
